import React from 'react'
import { useLocation } from 'react-router-dom';
import { UserPosts } from './UserPosts';

const UserProfile = () => {

    const location = useLocation();

  return (
    <div className="sig">
    <Box
      height={200}
      width={200}
      my={4}
      display="flex"
      alignItems="center"
      gap={4}
      p={2}
      sx={{ border: '2px solid grey' }}
    >
      This Box uses MUI System props for quick customization.
    </Box>
  );
}




         <h2 className='header-title'>User Details</h2> <br />
      <ul>
      <li>Name: {location.state.userData.name}</li>
      <li>Email: {location.state.userData.email}</li>
      <li>Phone: {location.state.userData.phone}</li>
      <li>WebSite: {location.state.userData.website}</li>
      </ul>

      <UserPosts/>
    </div>
  );
}

export default UserProfile
